import React from 'react'
import NewOrders from '../components/orders/NewOrders'
import {Switch, Route} from "react-router-dom"


export default function Orders(props) {


    return (
        <Switch>
            <Route path="/orders/:orderID">
            <NewOrders/>
            </Route>
        </Switch>

    )
}
